import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "./LogIn.css";

function LogIn() {
  const [emailLog, setEmailLog] = useState([]);
  const [passLog, setPassLog] = useState([]);
  // const [match, setMatch] = useState(false);
  let Navigate = useNavigate();
  var match = false;
  const HandleLogIn = () => {
    var usersData = [];
    usersData =
      JSON.parse(localStorage.getItem("Data")) == null
        ? []
        : JSON.parse(localStorage.getItem("Data"));

    console.log("UserData", usersData);

    if (emailLog.length == 0 || passLog.length == 0) {
      alert("Field is monditory");
    } else {
      var Status = false;
      for (let index = 0; index <= usersData.length - 1; index + 1) {
        if (
          emailLog === usersData[index].Email &&
          passLog === usersData[index].Pass
        ) {
          Status = true;

          break;
        }
      }
      console.log("status", Status);
    }

    //   if (Status === true) {
    //     match = true;
    //     //setMatch(true);
    //   } else {
    //     alert("not Match");
    //     match = false;
    //     //setMatch(false);
    //   }
    // }
  };
  return (
    <div className="LogIn">
      <div className="LogIn_Inner">
        <h1 className="Header">Log In</h1>
        <div className="LogIn_Inner_Email">
          <h5>Email</h5>
          <input
            type="text"
            placeholder="Type Your Email"
            onChange={(e) => {
              setEmailLog(e.target.value);
            }}
          />
        </div>
        <div className="LogIn_Inner_Password">
          <h5>Password</h5>
          <input
            type="text"
            placeholder="Type Your Password"
            onChange={(e) => {
              setPassLog(e.target.value);
            }}
          />
          <h4 style={{ margin: "auto", marginTop: "10px" }}>
            Forgot Password?
          </h4>
        </div>
        <div className="Register_Inner_Footer">
          {match ? (
            <Link to="/Home">
              {" "}
              <button type="button" onClick={HandleLogIn}>
                LogIn
              </button>
            </Link>
          ) : (
            <button type="button" onClick={HandleLogIn}>
              LogIn
            </button>
          )}

          <h4>
            Don't have an account? <span>Register.</span>
          </h4>
        </div>
      </div>
    </div>
  );
}

export default LogIn;
